import "./App.css";
import {useState} from 'react';

function App() {

  const [input, setinput] = useState(0);

  const increament=()=>{
    setinput(input+1);
  };

  return (
    <div className="App">
  <div>Counter App</div>
  {input}
  <button onlick ={{increament}}>Increase</button>
  </div>
  );
}

export default App;
